import React, { useState } from 'react';
import './Main.css';
import axios from "axios"; 

function Main()
{
    const [formData, setFormData] = useState({
        CustName: '',
        ShortName: '',
        CustType: '',
        Phone: '',
        Fax: '',
        email: '',
        URL: '',
        Address: '',
        City: '',
        State: '',
        Zip: '',
        Taxable: false,
        SalTaxId: '',
        ShpAddress: '',
        ShpCity: '',
        ShpState: '',
        ShpZip: '',
        Balance: '',
        CreditAmount: '',
        LastInvoice: '',
        LastSaleDate: '',
        PayTerms: '',
        SalesRep: '',
        LastModDate: '',
        LastModuser: ''
    });
    const handleChange = (e) => {
        const { name, value, type, checked } = e.target;
        setFormData({
            ...formData,
            [name]: type === 'checkbox' ? checked : value
        });
    };

    const handleSubmit = async (event) => {
        event.preventDefault();
        axios.post('http://localhost:8081/Main',formData)
        .then((response) => {
            console.log(response);
        })
        .catch(error => console.log(error));
    };




};


export default Main;
